sys_variable_value.value:
(function execute(inputs, outputs) {
    outputs.has_error = false;
    outputs.error_message = "";
    if (inputs.status_code != "201") {
        outputs.has_error = true;
        outputs.error_message = new JiraErrorHandler().setError(inputs.status_code, inputs.response_body);
    } else {
        var response = JSON.parse(inputs.response_body);
        outputs.issue = {};
        outputs.issue.id = response.id;
        outputs.issue.key = response.key;
        outputs.issue.url = response.self;
    }
})(inputs, outputs);

