sys_variable_value.value:
(function execute(inputs, outputs) {

    var utils = new JiraUtils();
    var customUtils = new JiraCustomUtils();

    inputs = utils.trimStringInputs(inputs);

    var fields = {
        project: {
            id: inputs.project
        },
        issuetype: {
            id: inputs.issuetype
        },
        summary: inputs.summary
    }

    if (!gs.nil(inputs.description)) {
        fields.description = inputs.description;
    }

    if (!gs.nil(inputs.duedate)) {
        fields.duedate = utils.getJiraFormattedDate(inputs.duedate);
    }

    fields[customUtils.getServiceNowCustomFieldID()] = inputs.task_id;

    fields[customUtils.getSeverityCustomFieldID()] = {
        value: customUtils.retrieveJiraSeverity(inputs.severity)
    }

    outputs.payload = JSON.stringify({
        fields: fields
    });

})(inputs, outputs);

